pragma solidity ^0.6.0;
import "./Force.sol";

contract ForceHelper {
    Force force;

    receive() external payable {}

    constructor(address forceAddr) public {
        force = Force(forceAddr);
    }

    function transfer() public {
        address(force).call.value(0.00001 ether);
    }
}

